VALUES ('3270190026884', 'Jus d\'orange sanguine', '@ Jus d\'orange sanguino. Flash pasteurisé. Réfrigéré. @ Bloedsinaasappelsap. Flash gepasteuriseerd. Gekoeld. Ingrédients • Ingrediênten @ Jus dorange sanguine. @Bloedsinaasappelsap. Origine • Oorsprong @ Les oranges sanguines de ce jus sont cultivées en U.E et hors U.E. Ce jus est conditionné en France. @ De bloedsinaasappelen van dit sap werden geteeld in en buiten de EU. Dit sap is verpakt in Frankrijk. Utilisation • Gebruik @Agitez délicatement avant d\'ouvrir et servez frais. @Voorzichtig schudden voor het openen en koel schenken. Conservation • Bewaring @ Avant et après ouverture, conservez votre brique au réfrigérateur entre +1 oc et +60C. À consommer de préférence avant le : voir sur le haut de la brique. Après ouverture, consommez-la dans les 4 jours. @ Voor en na opening uw pak in de koelkast bewaren tussen +1 oc en +60C. Ten minste houdbaar tot: zie bovenzijde pak. Eens geopend, binnen 4 dagen consumeren. Nutrition • Voeding', '', '0.5', '0.1', '8.7', '8.7', '0.8', '0.7', '0.03', '0.0118110236220472', '', '1');

