INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3270190217190', 'Saumon Fumé Cuite Au Feu De Bois Surgelée', 'Pâte : Farine de hlé, eau, huile de tournesol, levure boulangère, sel. Garniture : Purée de tomates, saumon fumé au bois de hêtre 10,7% (saumon, sel), fromage râpé 10,7% (maasdam 10,3%, fécule de pomme de terre), ccè-me liquide 5,9% (crème, épaississant. carraghénanes), olives noires dénoyautées 2,6% (olives, eau, sel, stabilisant : gluconate ferreux), huile de tournesol, sel, sucre, ail, oignon, origan, herbes de Provence, poivre, arômes naturels. Pourcentages exprimés sur la pizza garnie. Malgré tout le soin apporté à la fabrication de ce produit, il peut contenir des morceaux de noyau d\'olive. @ Pizza met gerookte zalm op beukenhout, kaas en room, gebakken op houtvuur - Diepvries. Ingrediënten: Deeg: Tarwebloem, water, zonnebloemolie, bakkersgist, zout. Garnituur: Tomatenpuree, zalm gerookt op beukenhout 10,7 % (zalm, zout), geraspte kaas 10,7% (maasdam 10,3%, aardappelzetmeel), vloeibare room 5,9% (room, verdikkingsmiddel: carrageen), ontpitte zwarte olijven 2,6% (olijven, water, zout, stabilisator: ijzer(ll)gluconaat), zonnebloemolie, zout, suiker, knoflook, ui, oregano, Provençaalse kruiden, peper, natuurlijke aroma\'s. Percentages uitgedrukt op de pizza met garnituur. Ondanks de zorg die besteed werd aan de productie van dit product, kunnen er nog stukjes olijfpit aanwezig zijn. Conservation / Bewaring @ À consommer de préférence avant la date indiquée sur le côté de l\'emballage et à conserver plusieurs mois à -18 oc dans un congélateur***. ATTENTION, NE PAS RECONGELER APRÈS DÉCONGÉLATION. @ Ten minste houdbaar tot de datum vermeld op de zijkant van de verpakking en bewaart meerdere maanden bij -18 oc in een diepvriezer***. NA ONTDOOIING NIET OPNIEUW INVRIEZEN.', '', '8.7', '4.1', '29', '4.5', '1.6', '8.3', '1.4', '0.551181102362205', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3270190217633', 'Cônes chocolat pistache', 'Glace au chocolat 34,2 % : Eau, _lait_ écrémé reconstitué, chocolat en poudre 4% (sucre, cacao en poudre), sirop de glucose-fructose, _lactose_ et protéines de _lait_, graisse de coprah, cacao en poudre, émulsifiant : mono- et diglycérides d\'acides gras, gélifiants : farine de graines de caroube et gomme guar.  Glace à la pistache 34,2% : Eau, sucre, sirop de glucose-fructose, _lactose_ et protéines de _lait_, graisse de coprah, pâte de _pistache_ 1%, émulsifiant : mono- et diglycérides d\'acides gras, gélifiants : farine de graines de caroube et gomme guar, arômes, colorants : curcumine et charbon végétal médicinal.  Gaufrette 16,7 % : Farine de _blé_, sucre, graisse de coprah, émulsifiant : lécithine de _soja_, sel. Chemisage (8%) et décor (2,2%) au cacao maigre 10,2 % : Graisse de coprah, sucre, cacao maigre en poudre 0,9%, émulsifiant : lécithine de _soja_.   Granelles de chocolat 2,9% : Pâte de cacao 1,3%, sucre, beurre de cacao, enrobage au sucre (sirop de sucre, sirop de glucose), émulsifiant : lécithine de _soja_, cacao maigre en poudre. Croquants à la noisette 1,8% : Sucre, _noisettes_ 0,4%.', 'https://static.openfoodfacts.org/images/products/327/019/021/7633/front.15.400.jpg', '12', '10', '36', '28', '1.3', '3.1', '0.2', '0.078740157480315', '', '0');

