ravet, suiker, magere cacaopoeder 0,7%, emulgator: sojalecithinen. Aardbeiensaus 6,2%: Aardbeien 2,8%, suiker, invertsuikerstroop, water, voedingszuur: citroenzuur, stabilisator: pectinen. Percentages uitgedrukt op het volledige product. Kan sporen bevatten van eieren, aardnoten en noten. Conservation / Bewaring @ À consommer de préférence avant la date indiquée sur le côté de l\'emballage et à conserver dans un à -180C. ATTENTION, NE PAS RECONGELER APRES DÉCONGÉLATI( @ Ten minste hoodbaar tot de datum vermeld op de zijkant van de verpakking en te bewar( in een op -180C. NA ONTDOOIING NIET OPNIEUW INVRIEZEN.', '', '10.7', '10.2', '36.8', '28.6', '0.9', '2.9', '0.17', '0.0669291338582677', '', '0');

